function getSqlStatement(eventId, isActive) {
    const ts = Date.now();

    return `WITH prevVals AS (
        SELECT ts FROM events 
        WHERE eventId = '${eventId}' ORDER BY ts DESC LIMIT 1 
    )
    UPDATE events SET d = ${ts} - (SELECT ts FROM prevVals), isActive = ${isActive ? 1 : 0}
    WHERE eventId = '${eventId}'`;
}


function toSqlString(field, value) {
    if (value == null)
        return "NULL";

    if (typeof value === "boolean")
        return value ? 1 : 0;

    if (field === "triggerCond")
        return value.op ? wrappedString(value.op + value.val) : "";

    return wrappedString(value);

    function wrappedString(val) {
        return "'" + val + "'"
    }
}


